import React, { useState } from "react";
import { Flex, Grid, Box, ThemeIcon } from "@mantine/core";
import {
  IconHome2,
  IconUser,
  IconSearch,
  IconMessageCircle,
  IconShoppingBag,
  IconBookmark,
} from "@tabler/icons-react";

const icons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconSearch", component: <IconSearch /> },
  { name: "IconShoppingBag", component: <IconShoppingBag /> },
  { name: "IconUser", component: <IconUser /> },
];
const blackicons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconBookmark", component: <IconBookmark /> },
  { name: "IconUser", component: <IconUser /> },
];
const redicons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconBookmark", component: <IconBookmark /> },
  { name: "IconUser", component: <IconUser /> },
];

const navbaritem = {
  flex1: (
    <Flex
      mih={40}
      bg="dark.9"
      justify="space-around"
      align="center"
      direction="row"
      wrap="wrap"
      style={{ border: "1px solid #1b1c1b" }}
    >
      {blackicons.map((blackicon, index) => (
        <ThemeIcon
          variant="gradient"
          size="md"
          aria-label="Gradient action icon"
          gradient={{ from: "red", to: "green", deg: 360 }}
        >
          {blackicon.component}
        </ThemeIcon>
      ))}
    </Flex>
  ),
  flex2: (
    <Flex
      mih={40}
      bg="white"
      justify="space-around"
      align="center"
      direction="row"
      wrap="wrap"
      style={{ border: "1px solid #1b1c1b" }}
    >
      {redicons.map((redicon, index) => (
        <ThemeIcon
          variant="gradient"
          size="md"
          aria-label="Gradient action icon"
          gradient={{ from: "violet", to: "red", deg: 155 }}
        >
          {redicon.component}
        </ThemeIcon>
      ))}
    </Flex>
  ),
  flex3: (
    <Flex
      mih={40}
      mt="xs"
      bg="white"
      justify="space-around"
      align="center"
      direction="row"
      wrap="wrap"
      style={{ border: "1px solid #1b1c1b" }}
    >
      {icons.map((icon, index) => (
        <ThemeIcon
          variant="gradient"
          size="md"
          aria-label="Gradient action icon"
          gradient={{ from: "green", to: "indigo", deg: 360 }}
        >
          {icon.component}
        </ThemeIcon>
      ))}
    </Flex>
  ),
};

const Navbar = () => {
  const [Item, SetItem] = useState(false);
  const [Item2, setItem2] = useState(false);
  const [Item3, setItem3] = useState(false);

  const handleStackClick = (index) => {
    return () => {
      if (index === 0) {
        SetItem(!Item);
        navBar(navbaritem.flex1);
      } else if (index === 1) {
        setItem2(!Item2);
        navBar(navbaritem.flex2);
      } else if (index === 2) {
        setItem3(!Item3);
        navBar(navbaritem.flex3);
      }
    };
  };

  return (
    <Grid>
      <Grid.Col span={6}>
        {[navbaritem.flex1, navbaritem.flex2, navbaritem.flex3].map(
          (flex, index) => (
            <Box key={index} onClick={handleStackClick(index)}>
              {flex}
            </Box>
          )
        )}
      </Grid.Col>
    </Grid>
  );
};

export default Navbar;
